css:
.outline-view {
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
}
.outline-view-core {
  font-size: var(--editor-font-size);
  font-family: var(--editor-font-family);
  line-height: var(--editor-line-height);
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
}
.outline-view-loading {
  margin: auto;
}
.outline-view-trees-scroller {
  flex-grow: 1;
  overflow: auto;
}
.outline-view-trees {
  display: inline-block;
  min-width: 100%;
}
.outline-view-trees .list-item {
  padding: 0 5px;
}
.outline-view-trees.has-collapsable-children .list-nested-item > .list-tree > .list-item {
  padding-left: 40px;
}
.panel-heading .outline-view-close-button {
  top: -0.25em;
}
.outline-view-search-bar {
  align-items: center;
  display: flex;
  flex: 0 0 auto;
  flex-direction: row;
  justify-content: space-between;
  margin: 5px;
  position: relative;
}
.outline-view-search-pane {
  flex-grow: 1;
}
.outline-view-search-clear {
  position: absolute;
  right: 0;
}
